<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Flow cytometric analysis of mammalian glial cultures treated with methotrexate . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00563

</mark>
 ( MTX ) is an antineoplastic drug that acts by competitive inhibition of the enzyme dihydrofolate reductase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374

</mark>
 ) . MTX treatment of cultured cell lines leads to the emergence of resistant cell populations . Studies using stepwise selection procedures have demonstrated that MTX resistance conferred by overproduction of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 can be caused by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 gene amplification . We examined the effect of MTX on cells whose origin more closely approximates the in vivo condition by developing a culture system using dissociated brain tissue from 17-19 day old mouse embryos . At the first passage , cultures were divided into control and MTX groups . Cells were treated with the same or successively higher concentrations of MTX at each passage over a 3-4 month period . The first passage eliminated neurons and left a glial culture comprised of approximately 90 % astrocytes . We used the Fluorescence Activated Cell Sorter in conjunction with fluorescent dyes to measure 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 content , DNA content , size , and viability of glial cells following MTX treatment . MTX-treated cells divided but grew more slowly and were larger than untreated cells . Stepwise selection in 30/60 / 90 nM or 60/120 nM MTX resulted in significant two - to threefold increases in fluorescence , and hence 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 levels . Slot hybridizations assays demonstrated a threefold increase in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 gene copy number in the DNA from the 30/60 / 90 cultures . Thus , our findings were consistent with the results obtained from somatic cell lines , and lend support to the hypothesis that gene amplification may be a common mechanism for the acquisition of resistance in many types of cells . They also indicate that glial cells may be a specific target for cytotoxic effects of MTX on the central nervous system .</div>

 ) to produce superoxide ( O2 * - ) . H4B was found recyclable from its oxidized form by dihydrofolate reductase (

<div class="entities" style="line-height: 2.5; direction: ltr">Integrative analysis of transcriptomics , proteomics , and metabolomics data of white adipose and liver tissue of high-fat diet and rosiglitazone-treated insulin-resistant mice identified pathway alterations and molecular hubs . The incidences of obesity and type 2 diabetes are rapidly increasing and have evolved into a global epidemic . In this study , we analyzed the molecular effects of high-fat diet ( HFD ) - induced insulin-resistance on mice in two metabolic target tissues , the white adipose tissue ( WAT ) and the liver . Additionally , we analyzed the effects of drug treatment using the specific PPARγ ligand rosiglitazone . We integrated transcriptome , proteome , and metabolome data sets for a combined holistic view of molecular mechanisms in type 2 diabetes . Using network and pathway analyses , we identified hub proteins such as

 in WAT and deregulation of major metabolic pathways in the insulin-resistant state , including the TCA cycle , oxidative phosphorylation , and branched chain amino acid metabolism . Rosiglitazone treatment resulted mainly in modulation via

<h2 style="margin: 0">10</h2>

 by roflumilast and NTHi . Phosphodiesterase 4B (

 ) plays a key role in regulating inflammation .

 , a phosphodiesterase ( PDE ) 4 - selective inhibitor , has recently been approved for treating severe chronic obstructive pulmonary disease (

 ) patients with exacerbation . However , there is also clinical evidence suggesting the development of tachyphylaxis or tolerance on repeated dosing of roflumilast and the possible contribution of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 up-regulation , which could be counterproductive for suppressing inflammation . Thus , understanding how 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is up-regulated in the context of the complex pathogenesis and medications of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 may help improve the efficacy and possibly ameliorate the tolerance of roflumilast . Here we show that roflumilast synergizes with nontypeable Haemophilus influenzae ( NTHi ) , a major bacterial cause of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 exacerbation , to up-regulate PDE 4B2 expression in human airway epithelial cells in vitro and in vivo . Up-regulated PDE 4B2 contributes to the induction of certain important chemokines in both enzymatic activity-dependent and activity-independent manners . We also found that protein kinase A catalytic subunit β ( PKA-Cβ ) and nuclear factor-κB ( NF-κB ) p65 subunit were required for the synergistic induction of PDE 4B2 . PKA-Cβ phosphorylates p65 in a DB02527 - dependent manner . Moreover , Ser 276 of p65 is critical for mediating the PKA-Cβ-induced p65 phosphorylation and the synergistic induction of PDE 4B2 . Collectively , our data unveil a previously unidentified mechanism underlying synergistic up-regulation of PDE 4B2 via a cross-talk between PKA-Cβ and p65 and may help develop new therapeutic strategies to improve the efficacy of DB05876 inhibitor .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Overexpression of folate binding protein alpha is one of the mechanism explaining the adaptation of HT29 cells to high concentration of methotrexate . The human colon adenocarcinoma cell line HT29 can be adapted to 10 ( - 7 ) - 10 ( - 4 ) M concentrations of methotrexate ( MTX ) . Cells adapted to 10 ( - 4 ) M MTX have an enterocyte-like phenotype with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 gene amplification . Presently , we hypothetized that an increased expression of folate binding protein ( FBP ) may participate to the MTX resistance of 10 ( - 4 ) MTX HT29 cells . The cDNA FBPalpha / beta-actin ratio of amplified transcripts was 4.8- and 1.5- fold higher in 10 ( - 4 ) and in 10 ( - 7 ) M MTX HT29 respectively , than in standard type HT29 cells . An increase of transcript level was observed when decreasing folic acid concentration . PI - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P98160

 cleaved 7.7 times more membrane FBP in 10 ( - 4 ) M than in 10 ( - 7 ) M MTX and wild type HT29 cells . In contrast to 10 ( - 7 ) M MTX cells , growth of 10 ( - 4 ) M MTX cells was dependent on folic acid concentration and abolished at a concentration lower than 0.9 microM . In conclusion , the adaptive mechanism of HT29 cells resistant to 10 ( - 4 ) M MTX is the result of the synergistic overexpression of both 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and FBPalpha . Overexpression of FBPalpha may be related to the enterocyte-like phenotype of the cells .</div>
